(1, 'Garlic China', 'garlic-china', '18082022123333-600x600-2-garlic.jpg', 'Vegetables are parts of plants that are consumed by humans or other animals as food.', '<p>Vegetables are parts of plants that are consumed by humans or other \r\nanimals as food. The original meaning is still commonly used and is \r\napplied to plants collectively to refer to all edible plant matter, \r\nincluding the flowers, fruits, stems, leaves, roots, and seeds.</p><ul><li>An alternative definition of the term is applied somewhat arbitrarily, often by culinary and cultural tradition.</li><li>It\r\n may exclude foods derived from some plants that are fruits, flowers, \r\nnuts, and cereal grains, but include savory fruits such as tomatoes and \r\ncourgettes, flowers such as broccoli, and seeds such as pulses.</li><li>Originally,\r\n vegetables were collected from the wild by hunter-gatherers and entered\r\n cultivation in several parts of the world, probably during the period \r\n10,000 BC to 7,000 BC, when a new agricultural way of life developed.</li></ul><p>At\r\n first, plants that grew locally would have been cultivated, but as time\r\n went on, trade brought exotic crops from elsewhere to add to domestic \r\ntypes.</p>', NULL, 15.00, 20.00, 25.00, '2023-06-24', '2023-06-24', 1, 1, 'PT-856054', 1, 150, NULL, '1', 1, 0, 2, 1, NULL, NULL, 'Box', NULL, 1, 1, NULL, 'en', 'garlic', '18082022123324-600x600-1-garlic.jpg', 'garlic descrtiption', 'garlic', NULL, '2023-06-24 04:29:48', '2023-06-27 04:18:36'),
(2, 'Almond (Badam)', 'almond-badam', '09092022091526-400x400-brand-5.png', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry.', '<p><strong style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">Lorem Ipsum</strong><span style=\"color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</span><br></p>', NULL, 100.00, 200.00, 250.00, '2023-06-27', '2023-06-27', 1, 1, 'PS-350212', 1, 250, NULL, '1', 1, 5, 2, 1, NULL, NULL, 'Box', NULL, 1, 1, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '2023-06-27 00:47:41', '2023-06-27 04:18:21');

